

def longsubstr(s):
    i=0
    n=len(s)
    max_len = 0
    stack= []
    while i<n:
        # print(s[i])
        if s[i] in stack:
            idx = stack.index(s[i])
            # print(stack)
            max_len = max(max_len, len(stack))
            stack = stack[idx+1:]
            # print(stack)
            stack.append(s[i])
        else:
            stack.append(s[i])
            max_len = max(max_len, len(stack))
        i+=1
    # print(max_len)
    # print(stack)
    return max_len

